import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  background-color: #000;
  color: #fff;
  text-align: center;
  padding: 50px 20px;
`;

const Title = styled.h1`
  font-size: 3em;
  margin: 0;
`;

const Subtitle = styled.p`
  font-size: 1.5em;
  margin: 10px 0;
`;

const ButtonContainer = styled.div`
  margin: 20px 0;
`;

const Button = styled.a`
  background-color: ${(props) => (props.primary ? '#000' : '#fff')};
  color: ${(props) => (props.primary ? '#fff' : '#000')};
  padding: 10px 20px;
  border-radius: 5px;
  text-decoration: none;
  margin: 0 10px;
  font-size: 1em;
  border: 2px solid ${(props) => (props.primary ? '#000' : '#fff')};

  &:hover {
    background-color: ${(props) => (props.primary ? '#fff' : '#000')};
    color: ${(props) => (props.primary ? '#000' : '#fff')};
  }
`;

const Note = styled.p`
  font-size: 0.9em;
  color: #888;
`;

const NewBadge = styled.div`
  background-color: #f90;
  color: #000;
  display: inline-block;
  padding: 5px 10px;
  border-radius: 5px;
  margin-top: 20px;
`;

const ThemesContainer = styled.div`
  margin-top: 50px;
`;

const ThemesTitle = styled.h2`
  font-size: 2.5em;
`;

const ThemesSubtitle = styled.p`
  font-size: 1.2em;
  margin: 10px 0;
`;

const ThemesGrid = styled.div`
  display: flex;
  justify-content: center;
  gap: 20px;
  margin-top: 30px;
`;

const ThemeCard = styled.div`
  background-color: #fff;
  color: #000;
  border-radius: 10px;
  overflow: hidden;
  width: 200px;
  text-align: left;
`;

const ThemeImage = styled.img`
  width: 100%;
  height: auto;
`;

const ThemeInfo = styled.div`
  padding: 10px;
`;

const ThemeTitle = styled.h3`
  font-size: 1.2em;
  margin: 0;
`;

const ThemeSubtitle = styled.p`
  font-size: 1em;
  color: #555;
`;

const SleeveSection = () => {
  return (
    <Container>
      <Title>Sleeve 2</Title>
      <Subtitle>The ultimate music accessory for your Mac.</Subtitle>
      <Subtitle>
        Sleeve sits on the desktop, displaying and controlling the music youâ€™re<br></br>
        currently playing in 
        <img src="/Inages/Applemusi" alt="Apple Music Icon" /> Apple Music, 
        <img src="/path_to_your_icons/spotify_icon.png" alt="Spotify Icon" /> Spotify, and 
        <img src="/path_to_your_icons/doppler_icon.png" alt="Doppler Icon" /> Doppler.
      </Subtitle>
      <ButtonContainer>
        <Button href="https://apps.apple.com">Mac App Store</Button>
        <Button primary href="https://buydirectly.com">Buy Directly $5.99</Button>
      </ButtonContainer>
      <Note>No subscriptions. No in-app purchases. Requires macOS 11 Big Sur or later.</Note>
      <NewBadge>Now with shelves and a progress bar. See what's new in Sleeve 2.3</NewBadge>
      <ThemesContainer>
        <ThemesTitle>NEW IN 2.0</ThemesTitle>
        <Subtitle>Themes. Unlimited themes.</Subtitle>
        <ThemesSubtitle>
          Themes in Sleeve make creating and switching between customizations easy. Share your own creations with friends and install as many themes as you like with just a double-click.
        </ThemesSubtitle>
        <ThemesGrid>
          <ThemeCard>
            <ThemeImage src="https://via.placeholder.com/200" alt="Eternal Sunshine" />
            <ThemeInfo>
              <ThemeTitle>Eternal Sunshine</ThemeTitle>
              <ThemeSubtitle>Forgotten Feels<br/>Slow Magic</ThemeSubtitle>
            </ThemeInfo>
          </ThemeCard>
          <ThemeCard>
            <ThemeImage src="https://via.placeholder.com/200" alt="Bunny Is a Rider" />
            <ThemeInfo>
              <ThemeTitle>Bunny Is a Rider</ThemeTitle>
              <ThemeSubtitle>Desire, I Want to Turn Into You<br/>Caroline Polachek</ThemeSubtitle>
            </ThemeInfo>
          </ThemeCard>
          <ThemeCard>
            <ThemeImage src="https://via.placeholder.com/200" alt="Are You Listening" />
            <ThemeInfo>
              <ThemeTitle>Are You Listening</ThemeTitle>
              <ThemeSubtitle>How to Be Human<br/>Chelsea Cutler</ThemeSubtitle>
            </ThemeInfo>
          </ThemeCard>
          <ThemeCard>
            <ThemeImage src="https://via.placeholder.com/200" alt="Creation Comes Alive" />
            <ThemeInfo>
              <ThemeTitle>Creation Comes Alive</ThemeTitle>
              <ThemeSubtitle>Petit Biscuit</ThemeSubtitle>
            </ThemeInfo>
          </ThemeCard>
        </ThemesGrid>
      </ThemesContainer>
    </Container>
  );
};

export default SleeveSection;
